import HomePage from './components/homePage.component';
import Destinations from './components/destinations.component'
import {  BrowserRouter, Routes,Route} from "react-router-dom";
import MyPage from './components/myPage.component'
import LoginRegisterForm from './components/register.component'
import MyFlights from './components/myFlights'
function App() {
  return (
    <BrowserRouter>
    <Routes>

       <Route exact path="/" element={<HomePage />} />
       <Route path="/api/v1/destination" element={<Destinations />} />
       <Route path="/register" element={<LoginRegisterForm />} />
       <Route path="/myPage/:id" element={<MyPage />} />
       {/* this needs to take an id the myFlights page */}
       <Route path="/myFlights" element={<MyFlights />} />
    </Routes>
